				{
					return DefaultValue;
				}
				if (Radix < 1 || Radix > 36)
				{
					return DefaultValue;
				}
				int num = 0;
				bool flag = false;
				bool flag2 = false;
				int length = strData.Length;
				for (int i = StartIndex; i < length; i++)
				{
					char c = strData[i];
					if (!char.IsWhiteSpace(c))
					{
						bool flag3 = false;
						int num2 = 0;
						if (c >= '0' && c <= '9')
						{
							num2 = c - 48;
							flag3 = true;
						}
						else if (Radix > 10)
						{
							if (c >= 'A' && c <= 'Z')
							{
								num2 = c - 65 + 10;
								flag3 = true;
							}
							else if (c >= 'a' && c <= 'z')
							{
								num2 = c - 97 + 10;
								flag3 = true;
							}
						}
						if (flag3)
						{
							if (num2 >= Radix)
							{
								break;
							}
							num = num * Radix + num2;
							flag2 = true;
						}
						else
						{
