		public static int[] ToInt32Values(string strText)
		{
			if (strText == null || strText.Length == 0)
			{
				return null;
			}
			ArrayList arrayList = new ArrayList();
			int num = 0;
			bool flag = false;
			bool flag2 = false;
			for (int i = 0; i < strText.Length; i++)
			{
				bool flag3 = i == strText.Length - 1;
				char c = strText[i];
				if (c >= '0' && c <= '9')
				{
					num = num * 10 + c - 48;
					flag = true;
				}
				else if (c == '-')
				{
					if (flag)
					{
						flag3 = true;
						i--;
					}
					else
					{
						flag2 = true;
					}
				}
				else
				{
					flag3 = true;
				}
				if (!flag3)
				{
					continue;
				}
				if (flag)
				{
					if (flag2)
					{
						num = -num;
					}
					arrayList.Add(num);
					num = 0;
				}
				flag2 = false;
				flag = false;
			}
			if (arrayList.Count > 0)
			{
				return (int[])arrayList.ToArray(typeof(int));
			}
			return null;
		}

