			bool flag = false;
			bool flag2 = false;
			bool flag3 = false;
			int num2 = 0;
			for (int i = 0; i < strText.Length; i++)
			{
				bool flag4 = i == strText.Length - 1;
				char c = strText[i];
				if (c >= '0' && c <= '9')
				{
					num = num * 10.0 + (double)(int)c - 48.0;
					flag = true;
					if (flag3)
					{
						num2++;
					}
				}
				else
				{
					switch (c)
					{
					case '.':
						if (flag && flag3)
						{
							flag4 = true;
							i--;
							break;
						}
						if (flag3)
						{
							flag2 = false;
						}
						flag3 = true;
						break;
					case '-':
						if (flag)
						{
							flag4 = true;
							i--;
							break;
						}
						flag2 = true;
						if (!flag)
						{
							flag3 = false;
						}
						break;
					default:
						if (flag)
						{
							flag2 = (c == '-');
							flag4 = true;
						}
						break;
					}
				}
				if (!flag4)
				{
					continue;
				}
				if (flag)
				{
					if (flag2)
					{
						num = 0.0 - num;
					}
					if (num2 > 0)
					{
						num /= Math.Pow(10.0, num2);
					}
					arrayList.Add(num);
					num = 0.0;
				}
				num2 = 0;
				flag2 = false;
				flag3 = false;
				flag = false;
			}
			if (arrayList.Count > 0)
			{
				return (double[])arrayList.ToArray(typeof(double));
			}
			return null;
		}

