		private static bool IsBlankString(string strData)
		{
			if (strData == null)
			{
				return true;
			}
			int num = 0;
			while (true)
			{
				if (num < strData.Length)
				{
					if (!char.IsWhiteSpace(strData[num]))
					{
						break;
					}
					num++;
					continue;
				}
				return true;
			}
			return false;
		}

